// pages/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Page.css';

export default function Home() {
  return (
    <div className="page home">
      {/* Header image placeholder */}
      <img src="" alt="Flip N Match" className="placeholder header-img" />

      <p className="subheading">Choose your difficulty level</p>

      <div className="card-row">
        <Link to="/easy">
          <img src="" alt="Easy" className="placeholder card-img" />
        </Link>
        <Link to="/medium">
          <img src="" alt="Medium" className="placeholder card-img" />
        </Link>
        <Link to="/hard">
          <img src="" alt="Hard" className="placeholder card-img" />
        </Link>
      </div>
    </div>
  );
}
